import React from "react";

function Card(porps) {

    return(
        <div className="bg-white p-3 rounded-4 d-flex flex-column gap-2 ">
            <img className="rounded-circle align-self-center" src="https://picsum.photos/250" alt=""></img>
            <h1 className="fs-4 align-self-center">{porps.employees.name}</h1>
            <h3 className="fs-5 text-primary  align-self-center">{porps.employees.job}</h3>
            <ul className="fs-6 list-group font-weight-light">
                <li className="list-group-item">{porps.employees.phone}</li>
                <li className="list-group-item">{porps.employees.email}</li>
                <li className="list-group-item">WebSite : mahmoud.com</li>
            </ul>

        </div>
    );


}

export default Card;
